import React,{useContext, useEffect, useState} from 'react';
import signup1 from './signup1.jpg';
import Input from '../input/Input';


const Login = () => {

	return (
		<div className="row white">
			<form className="form col s6">
				<div className="row col s6">
				<Input name="email" placeholder="Email" label="Email" type="email"/>
					</div>
				<div className="row col s6">
				<Input name="password" placeholder="Password" label="Password" type="password"/>
				</div>


				<button className="btn orange darken-2">LOGIN</button>
			</form>
			<div>

			<img src={signup1} alt="login" className="login-image" />
			</div>
		</div>

	)
}

export default Login;
